"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Autism (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/autism-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H45588236\">",
"      <span class=\"h1\">",
"       What is autism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Autism is a brain disorder that impairs a person&rsquo;s behavior and ability to communicate and interact with others. It is one of a group of disorders called &ldquo;autism spectrum disorders&rdquo; that have similar effects on the brain. These disorders can be mild or severe. No one knows what causes them.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H45588243\">",
"      <span class=\"h1\">",
"       What are the key symptoms of autism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To be diagnosed with autism, a child must show signs of the disorder by the age of 3. The signs of autism include problems in three key areas:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Social interaction",
"        </strong>",
"        &ndash; Children with autism have trouble relating to others. They often don't know how to read facial expressions, and they tend to avoid eye contact. Plus, they often dislike being touched. Many young children with autism prefer not to play or interact with others.",
"       </li>",
"       <li>",
"        <strong>",
"         Communication",
"        </strong>",
"        &ndash; Children with autism often take much longer than other children to learn to speak. Some never learn to speak. But speech is not the only thing that's affected. The parents of children with autism sometimes think the children are deaf. But deaf children who cannot speak look for other ways to communicate, such as through hand motions. Children with autism do not. They do not seem to care whether they can communicate.",
"       </li>",
"       <li>",
"        <strong>",
"         Limited interests",
"        </strong>",
"        &ndash; Children with autism tend to show intense interest in certain things. But they show little interest in anything else. Young children might get completely focused on things that spin or shine and ignore most everything else. Older children might become preoccupied with one topic, such as the weather, numbers, or sports. Children with autism also tend to have rituals that they must follow exactly. For example, they might need to eat particular foods in a specific order, or to take the same route from one place to another&mdash;every time. If these habits get disrupted, the children get upset.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H45588250\">",
"      <span class=\"h1\">",
"       What other things should parents watch for?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To learn about other signs of autism, see this table (",
"      <a class=\"graphic graphic_table graphicRef77412 \" href=\"mobipreview.htm?31/33/32283\">",
"       table 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H45588257\">",
"      <span class=\"h1\">",
"       When should I take my child to a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Take your child to a doctor or nurse if you see any of the signs of autism listed above or in the table. You may also want to have your child's hearing tested. That way you can find out whether hearing problems are causing some of the symptoms you see.",
"     </p>",
"     <p>",
"      If the doctor or nurse suspects autism, he or she will probably send you to see a team of experts who know how to spot autism. The members of this team will:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Ask you lots of questions about your child and your family",
"       </li>",
"       <li>",
"        Test your child's abilities in lots of ways",
"       </li>",
"       <li>",
"        Make sure that the child's symptoms are not caused by another problem",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your child does have autism, it's important that he or she be diagnosed as soon as possible. Some of the problems caused by autism can be improved if they are caught early.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H45588264\">",
"      <span class=\"h1\">",
"       How is autism treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The right treatment for autism depends on the age of the child, how severe the disorder is, and whether the child has any other medical problems. Autism cannot be cured, but children are often able to overcome many of the problems caused by the disorder.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H45588271\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?24/18/24865?source=see_link\">",
"       Patient information: Asperger syndrome (The Basics)",
"      </a>",
"     </p>",
