" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Congenital syphilis: Facial stigmata",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 344px; height: 432px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Facial stigmata of congenital syphilis depicted above include bulging of the frontal bones and depression of the nasal bridge (\"saddle nose\"), both due to periostitis; rhinitis from weeping nasal mucosal lesions (\"snuffles\"); and a circumoral rash.",
