"   </div>",
"   <div class=\"lgnd\">",
"    The subcostal view of a 2-D echocardiogram shows a large pericardial effusion encircling the heart which shows a \"swinging\" motion during the cardiac cycle. There is also diastolic collapse of the right atrium and ventricle, a result of tamponade.",
"    <div class=\"footnotes\">",
"    </div>",
