"     </li>",
"     <li>",
"      Ferrematos (IT);",
"     </li>",
"     <li>",
"      Ferrlecit (DE, HU);",
"     </li>",
"     <li>",
"      Ferro-Agepha (AT);",
"     </li>",
"     <li>",
"      Ferro-Gradumet (BG);",
"     </li>",
"     <li>",
"      Ferrogluconaat FNA (NL);",
"     </li>",
"     <li>",
"      ferrominerase (DE);",
"     </li>",
"     <li>",
"      Ferronal (IL);",
"     </li>",
"     <li>",
"      Ferrum Verla (DE);",
"     </li>",
"     <li>",
"      Glucoferro (IT);",
"     </li>",
"     <li>",
"      Hemototal (PT);",
"     </li>",
"     <li>",
"      Imperon (ES);",
"     </li>",
"     <li>",
"      Ironax (IT);",
"     </li>",
"     <li>",
"      Losferon (FR);",
"     </li>",
"     <li>",
"      Losferron (DE, IT, LU, NL);",
"     </li>",
"     <li>",
"      Oligostim Fe (BE);",
"     </li>",
"     <li>",
"      Rulofer G (DE);",
"     </li>",
"     <li>",
"      Sustemial (IT);",
"     </li>",
"     <li>",
"      Vitaferro Brause (DE)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F170807\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Replaces iron found in hemoglobin, myoglobin, and enzymes; allows the transportation of oxygen via hemoglobin",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F170824\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Onset of action: Hematologic response: Oral: 3-10 days; peak reticulocytosis occurs in 5-10 days, and hemoglobin values increase in &sim;2-4 weeks",
"    </p>",
"   </div>",
"  </div>",
