var title_f37_37_38492="Dx asbestos disease B";
var content_f37_37_38492=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F71021&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F71021&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for diagnosis of nonmalignant lung disease related to asbestos",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\" class=\"container\">",
"     <tbody>",
"      <tr>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            1986 Guidelines",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Rule out other causes of interstitial fibrosis or obstructive disease",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            \"Evidence of abnormal test\"",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Crackles, bilateral, not cleared by cough",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Restrictive disease",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Reduced diffusing capacity",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            2004 Guidelines",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Exclusion of alternative diagnoses",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1_start\">",
"            Evidence of functional impairment, as demonstrated by one or more of the of following:",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Signs and symptoms (including crackles)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Change in ventilatory function (restrictive, obstructive patterns in context or disease history)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Impaired gas exchange (eg, reduced diffusing capacity)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Inflammation (eg, by bronchoalveolar lavage)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Exercise testing",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Comparison and notes",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            The 1986 guidelines primarily addressed asbestosis but mentioned smoking as a cause of obstructive disease. Implicit in the article, however, is that nonmalignant diseases presenting similarly to asbestos-related disease should also be ruled out.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Functional assessment is not required for diagnosis but is part of a complete evaluation. It contributes to diagnosis in defining the activity of disease and the resulting impairment.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Signs and symptoms are not specific for diagnosis but are valuable in assessing impairment.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            The 1986 criteria admitted the possibility of obstructive disease; the 2004 criteria address this specifically.",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            The 1986 guidelines noted possible utility of bronchoalveolar lavage and gallium scanning but considered them to be experimental techniques. The 2004 guidelines exclude gallium scanning, suggest that additional indicators of active inflammation may become useful in future.",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Am J Respir Crit Care Med vol 170 pp 692, 2004; www.atsjournals.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
